using Microsoft.IdentityModel.Clients.ActiveDirectory;
using Newtonsoft.Json;
using Newtonsoft.Json.Linq;
using OneNoteSample.Models;
using OneNoteSample.Utils;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Net.Http;
using System.Net.Http.Headers;
using System.Threading.Tasks;
using System.Web;
using System.Web.Mvc;

namespace OneNoteSample.Controllers
{
    [Authorize]
    public class HomeController : Controller
    {
        private const string BASE64_PIC = "";
        public ActionResult Error()
        {
            return View();
        }
        public ActionResult Confirm()
        {
            return View();
        }

        [HttpGet]
        public async Task<ActionResult> Index()
        {
            //first get an access token using the refresh token
            AuthenticationContext context = new AuthenticationContext(SettingsHelper.AzureADAuthority);
            var token = await context.AcquireTokenByRefreshTokenAsync(((AuthenticationResult)Session[SettingsHelper.UserTokenCacheKey]).RefreshToken, 
                new ClientCredential(SettingsHelper.ClientId, SettingsHelper.ClientSecret));

            //perform the http get on sections
            HttpClient client = new HttpClient();
            client.DefaultRequestHeaders.Add("Authorization", "Bearer " + token.AccessToken);
            using (var response = await client.GetAsync("https://graph.microsoft.com/beta/me/notes/sections"))
            {
                if (response.IsSuccessStatusCode)
                {
                    var json = JObject.Parse(await response.Content.ReadAsStringAsync());
                    List<Section> sections = json.SelectToken("value").ToObject<List<Section>>();
                    return View(sections);
                }
                else
                    return RedirectToAction("Error");
            }
        }

        [HttpPost]
        public async Task<ActionResult> Index(Section section)
        {
            //first get an access token using the refresh token
            AuthenticationContext context = new AuthenticationContext(SettingsHelper.AzureADAuthority);
            var token = await context.AcquireTokenByRefreshTokenAsync(((AuthenticationResult)Session[SettingsHelper.UserTokenCacheKey]).RefreshToken,
                new ClientCredential(SettingsHelper.ClientId, SettingsHelper.ClientSecret));

            //create StreamContent from base64 pic
            byte[] imageBytes = Convert.FromBase64String(BASE64_PIC);
            StreamContent rzpic = new StreamContent(new MemoryStream(imageBytes, 0, imageBytes.Length));
            rzpic.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");

            //prepare the payload
            var html = @"
                <html xmlns='http://www.w3.org/1999/xhtml' lang='en-us'>
                    <head>
                        <title>Super Cool Page</title>
                        <meta name='created' content='{0}' />
                    </head>
                    <body>
                        <h2>Here is a header</h2>
                        <p>This page was generated programmatically with the Microsoft Graph. Here is an awesome picture:</p>
                        <img src='name:rzpic'/>
                    </body>
                </html>";
            HttpContent content = new MultipartFormDataContent()
            {
                { new StringContent(String.Format(html, DateTime.Now.ToString("o")), System.Text.Encoding.UTF8, "text/html"), "Presentation" },
                { rzpic, "rzpic" }
            };

            //create the page
            HttpClient client = new HttpClient();
            client.DefaultRequestHeaders.Add("Authorization", "Bearer " + token.AccessToken);
            using (var response = await client.PostAsync(String.Format("https://graph.microsoft.com/beta/me/notes/sections/{0}/pages", section.id), content))
            {
                if (response.IsSuccessStatusCode)
                {
                    return RedirectToAction("Confirm");
                }
                else
                    return RedirectToAction("Error");
            }
        }
    }
}